import React from "react";
import Link from "next/Link";

const Navigation = () => {
  return (
    <ul>
      <Link href="/">
        <a>Index</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
      <Link href="/services">
        <a>Services</a>
      </Link>
    </ul>
  );
};

export default Navigation;
